import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

/* ---------- Booking ID ---------- */
function generateBookingId() {
  return "GSC-" + Math.floor(100000 + Math.random() * 900000);
}

/* ---------- OPTIONAL LOGO (BASE64) ---------- */
/*
  ðŸ‘‰ Convert your logo to Base64 and paste it here
  ðŸ‘‰ If empty, PDF will still generate safely
*/
const LOGO_BASE64 = "data:image/png;base64,"; // e.g. data:image/png;base64,iVBORw0KGgo...

export function generateBookingPDF(payload: any) {
  const doc = new jsPDF("p", "mm", "a4");

  const brand: [number, number, number] = [230, 81, 0];
  const pageWidth = doc.internal.pageSize.width;
  const pageHeight = doc.internal.pageSize.height;
  const bookingId = generateBookingId();

  /* ================= HEADER ================= */
  doc.setFillColor(255, 245, 235);
  doc.rect(0, 0, pageWidth, 42, "F");

  // Logo (safe)
  try {
    if (LOGO_BASE64.startsWith("data:image")) {
      doc.addImage(LOGO_BASE64, "PNG", 15, 8, 32, 26);
    }
  } catch {
    /* ignore logo errors */
  }

  doc.setFont("helvetica", "bold");
  doc.setFontSize(17);
  doc.setTextColor(...brand);
  doc.text("GURUKRUPA SAMRAT CATERING", 52, 20);

  doc.setFontSize(10);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(90);
  doc.text("Professional Catering & Event Services", 52, 27);

  // Right header
  doc.setFont("helvetica", "bold");
  doc.setFontSize(10);
  doc.setTextColor(60);
  doc.text(`Booking ID: ${bookingId}`, pageWidth - 15, 18, { align: "right" });

  doc.setFont("helvetica", "normal");
  doc.text("+91 98765 43210", pageWidth - 15, 25, { align: "right" });
  doc.text("Amravati, Maharashtra", pageWidth - 15, 31, { align: "right" });

  /* ================= CUSTOMER CARD ================= */
  let y = 55;

  doc.setFont("helvetica", "bold");
  doc.setFontSize(14);
  doc.setTextColor(40);
  doc.text("Booking Summary", 20, y);

  y += 6;
  doc.setDrawColor(...brand);
  doc.line(20, y, pageWidth - 20, y);

  y += 6;

  doc.setFillColor(250, 250, 250);
  doc.setDrawColor(230);
  doc.roundedRect(20, y, pageWidth - 40, 32, 4, 4, "FD");

  const col1L = 26;
  const col1V = 60;
  const col2L = 120;
  const col2V = 145;

  y += 10;
  doc.setFontSize(10);

  doc.setFont("helvetica", "bold");
  doc.setTextColor(...brand);
  doc.text("Customer:", col1L, y);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(60);
  doc.text(payload.customer?.name || "-", col1V, y);

  doc.setFont("helvetica", "bold");
  doc.setTextColor(...brand);
  doc.text("Phone:", col2L, y);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(60);
  doc.text(payload.customer?.phone || "-", col2V, y);

  y += 8;
  doc.setFont("helvetica", "bold");
  doc.setTextColor(...brand);
  doc.text("Event:", col1L, y);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(60);
  doc.text(payload.eventType || "-", col1V, y);

  doc.setFont("helvetica", "bold");
  doc.setTextColor(...brand);
  doc.text("Date:", col2L, y);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(60);
  doc.text(payload.date || "-", col2V, y);

  y += 8;
  doc.setFont("helvetica", "bold");
  doc.setTextColor(...brand);
  doc.text("Guests:", col1L, y);
  doc.setFont("helvetica", "normal");
  doc.setTextColor(60);
  doc.text(`${payload.guests || 0} People`, col1V, y);

  /* ================= MENU TABLE ================= */
  const rows: any[] = [];

  Object.entries(payload.menu || {}).forEach(([category, items]: any) => {
    if (!items?.length) return;

    rows.push([
      {
        content: category.toUpperCase(),
        colSpan: 2,
        styles: {
          fillColor: [255, 245, 235],
          textColor: brand,
          fontStyle: "bold",
          halign: "center",
        },
      },
    ]);

    items.forEach((item: any) => {
      rows.push([`â€¢ ${item.name}`, `â‚¹ ${item.price}`]);
    });
  });

  autoTable(doc, {
    startY: y + 12,
    head: [["Menu Item", "Price"]],
    body: rows,
    theme: "grid",
    styles: {
      fontSize: 10,
      cellPadding: 6,
      textColor: 50,
    },
    headStyles: {
      fillColor: brand,
      textColor: 255,
      fontStyle: "bold",
    },
    columnStyles: {
      1: { halign: "right", fontStyle: "bold", cellWidth: 40 },
    },
    margin: { left: 20, right: 20 },
  });

  /* ================= TOTAL ================= */
  const finalY = (doc as any).lastAutoTable.finalY + 10;

  doc.setFillColor(...brand);
  doc.roundedRect(pageWidth - 85, finalY, 65, 14, 3, 3, "F");

  doc.setFont("helvetica", "bold");
  doc.setFontSize(12);
  doc.setTextColor(255);
  doc.text("NET TOTAL", pageWidth - 80, finalY + 9);
  doc.text(
    `â‚¹ ${payload.totalAmount?.toLocaleString() || 0}`,
    pageWidth - 29,
    finalY + 9,
    { align: "right" }
  );

  /* ================= FOOTER ================= */
  doc.setFont("helvetica", "normal");
  doc.setFontSize(9);
  doc.setTextColor(140);
  doc.text(
    "Thank you for choosing Gurukrupa Samrat Catering.",
    pageWidth / 2,
    pageHeight - 18,
    { align: "center" }
  );
  doc.text(
    "We look forward to serving you and making your event memorable.",
    pageWidth / 2,
    pageHeight - 12,
    { align: "center" }
  );

  /* ================= SAVE ================= */
  doc.save(`Gurukrupa_Booking_${bookingId}.pdf`);
}
